
{"quote": ["1. \u201cHelp me, Obi-Wan Kenobi. You\u2019re my only hope.\u201d \u2014 Leia Organa", "2. \u201cI find your lack of faith disturbing.\u201d \u2014 Darth Vader", "3. \u201cIt\u2019s the ship that made the Kessel run in less than twelve parsecs. I\u2019ve outrun Imperial starships. Not the local bulk cruisers, mind you. I\u2019m talking about the big Corellian ships, now. She\u2019s fast enough for you, old man.\u201d \u2014 Han Solo", "4. \u201cThe Force will be with you. Always.\u201d \u2014 Obi-Wan Kenobi", "5. \u201cWhy, you stuck-up, half-witted, scruffy-looking ", "!\u201d \u2014 Leia Organa", "6. \u201cNever tell me the odds!\u201d \u2014 Han Solo", "7. \u201cDo. Or do not. There is no try.\u201d \u2014 Yoda", "8. \u201cNo. ", " am your father.\u201d \u2014 Darth Vader", "9. \u201cWhen gone am I, the last of the Jedi will you be. The Force runs strong in your family. Pass on what you have learned.\u201d \u2014 Yoda", "10. \u201cI\u2019ll ", " turn to the dark side. You\u2019ve failed, your highness. I am a Jedi, like my father before me.\u201d \u2014 Luke Skywalker", "11. \u201cNow, young Skywalker, you will die.\u201d \u2014 Emperor Palpatine", "12. \u201cJust for once, let me look on you with my own eyes.\u201d \u2014 Anakin Skywalker", "13. \u201cThere\u2019s always a bigger fish.\u201d \u2014 Qui-Gon Jinn", "14. \u201cIn time, the suffering of your people will persuade you to see our point of view.\u201d \u2014 Nute Gunray", "15. \u201cYou can\u2019t stop the change, any more than you can stop the suns from setting.\u201d \u2014 Shmi Skywalker", "16. \u201cFear is the path to the dark side. Fear leads to anger; anger leads to hate; hate leads to ", ". I sense much fear in you.\u201d \u2014 Yoda", "17. \u201cWell, if droids could ", ", there\u2019d be none of us here, would there?\u201d \u2014 Obi-Wan Kenobi", "18. \u201cWe must keep our faith in the Republic. The day we stop believing democracy can work is the day we lose it.\u201d \u2014 Queen Jamillia", "19. \u201cI\u2019m just a simple man trying to make my way in the universe.\u201d \u2014 Jango Fett", "20. \u201cWhat if I told you that the Republic was now under the control of a\u00a0Dark Lord of the Sith?\u201d \u2014 Count Dooku", "21. \u201cThe dark side of the Force is a pathway to many abilities some consider to be unnatural.\u201d \u2014 Chancellor Palpatine", "22. \u201cPower! ", " power!\u201d \u2014 Darth Sidious", "23. \u201cSo this is how liberty dies. With thunderous applause.\u201d \u2014 Padm\u00e9 Amidala", "24. \u201cYou were my brother, Anakin. I loved you.\u201d \u2014 Obi-Wan Kenobi", "25. \u201cTo die for one\u2019s people is a great sacrifice. To live for one\u2019s people, an even greater sacrifice. I choose to live for my people.\u201d \u2014 Riyo Chuchi (Season One, Episode 15, \u201cTrespass\u201d)", "26. \u201cYou are the Chosen One. You have brought balance to this world. Stay on this path, and you will do it again for the galaxy. But beware your heart.\u201d \u2014 The Father (Season Three, Episode 17, \u201cGhosts of Mortis\u201d)", "27. \u201cRemember, my dear Obi-Wan. I\u2019ve loved you always. I always will.\u201d \u2014 Duchess Satine Kryze (Season Five, Episode 16, \u201cThe Lawless\u201d)", "28. \u201cThe Sith killed each other, victims of their own greed. But from the ashes of their destruction, I was the last survivor. I chose to pass my knowledge on to only one. I created a legacy so resilient that now you come before me.\u201d \u2014 Darth Bane (Season Six, Episode 13, \u201cSacrifice\u201d)", "29. \u201cThe Sith took everything from me. Ripped me from my mother\u2019s arms, murdered my brother, used me as a weapon, and then cast me aside. Abandoned me. Once, I had power \u2014 now I have ", ".\u201d \u2014 Maul (Season Two, Episode 21, \u201cTwilight of the Apprentice\u201d)", "30. \u201cI am no Jedi.\u201d \u2014 Ahsoka Tano (Season Two, Episode 21, \u201cTwilight of the Apprentice\u201d)", "31. \u201cAn object cannot make you good or evil. The temptation of power, forbidden knowledge, even the desire to do ", " can lead some down that path. But only you can change yourself.\u201d \u2014 Bendu (Season Three, Episode 1, \u201cSteps into Shadow\u201d)", "32. \u201cIf you define yourself by your power to take life, your desire to dominate, to possess, then you have nothing.\u201d \u2014 Obi-Wan Kenobi (Season Three, Episode 20, \u201cTwin Suns\u201d)", "33. \u201cThe garbage\u2019ll do!\u201d \u2014 Rey", "34. \u201cChewie, we\u2019re home.\u201d \u2014 Han Solo", "35. \u201cYou know, no matter how much we fought, I\u2019ve always hated watching you leave.\u201d \u2014 Leia Organa", "36. \u201cOh, my dear friend. How I\u2019ve missed you.\u201d \u2014 C-3PO", "37. \u201cI\u2019m one with the Force. The Force is with me.\u201d \u2014 Chirrut \u00cemwe", "38. \u201cEvery time I walked away from something I wanted to forget, I told myself it was for a cause that I believed in. A cause that was worth it. Without that, we\u2019re lost.\u201d \u2014 Cassian Andor", "39. \u201cJyn, I\u2019ll be there for you. Cassian said I had to.\u201d \u2014 K-2SO", "40. \u201cHope.\u201d \u2014 Leia Organa"], "url": "https://www.starwars.com/news/40-memorable-star-wars-quotes"}
